import * as React from 'react';
import data from '../data/data-temp';
import { ListGroup, ListGroupItem } from 'reactstrap';
interface IOverviewProps {}

export const Overview: React.FunctionComponent<IOverviewProps> = props => {
  console.log(data);

  const numberOfMale = data.filter(a => a.sex === 'Male').length;
  const numberOfFemale = data.filter(a => a.sex === 'Female').length;

  return (
    <ListGroup>
      <ListGroupItem>Total confirmed case: {data.length}</ListGroupItem>
      <ListGroupItem>
        <Sex></Sex>
        Male: {numberOfMale} Female: {numberOfFemale}
      </ListGroupItem>
      <ListGroupItem></ListGroupItem>
    </ListGroup>
  );
};
